import React from 'react';
import styled from 'styled-components';
import AdImg from '../../assets/ad.svg';

// eslint-disable-next-line react/function-component-definition
const Ad = (props) => {
  const aa = props;
  console.log(aa.showAD);
  if (!aa.showAD) {
    return null;
  }

  return <ADImg />;
};

const ADImg = styled.img.attrs({
  src: AdImg,
  alt: '광고이미지',
})`
  width: 100%;
  height: 80px;
`;

export default Ad;
